// SPDX-License-Identifier: GPL-3.0

pragma solidity ^0.8.0;
import "../node_modules/@openzeppelin/contracts/token/ERC721/IERC721.sol";

contract NFTMarketPlace {
    struct AuctionItem {
        uint256 id;
        address tokenAddress;
        uint256 tokenId;
        address payable seller;
        uint256 askingPrice;
        bool isSold;
        bool bidItem;
        uint256 bidPrice;
        address bidderAddress;
    }

    AuctionItem[] public itemsForSale;
    
    //to check if item is open to market
    mapping (address => mapping (uint256 => bool)) activeItems;

    //to get auctionItemId from tokenId
    mapping (uint256 => uint256) auctionItemId;

    //eth to be returned to an address for an specific bid
    mapping (address => mapping (uint256 => uint256)) pendingReturns;

    event ItemAdded(uint id, uint tokenId, address tokenAddress, uint256 askingPrice, bool bidItem);
    event ItemSold(uint id, address buyer, uint256 askingPrice);

    modifier OnlyItemOwner(address tokenAddress, uint256 tokenId){
        IERC721 tokenContract = IERC721(tokenAddress);
        require(tokenContract.ownerOf(tokenId) == msg.sender);
        _;
    }
    modifier OnlyItemOwnerAuc(uint256 aucItemId){
        IERC721 tokenContract = IERC721(itemsForSale[aucItemId-1].tokenAddress);
        require(tokenContract.ownerOf(itemsForSale[aucItemId-1].tokenId) == msg.sender);
        _;
    }
    modifier HasTransferApproval(address tokenAddress, uint256 tokenId){
        IERC721 tokenContract = IERC721(tokenAddress);
        require(tokenContract.getApproved(tokenId) == address(this));
        _;
    }
    modifier ItemExists(uint256 id){
        require(id-1 < itemsForSale.length && itemsForSale[id-1].id == id, "Could not find Item");
        _;
    }
    modifier IsForSale(uint256 id){
        require(itemsForSale[id-1].isSold == false,"Item already sold");
        _;
    }
    modifier IsForInstantBuy(uint256 id){
        require(itemsForSale[id-1].bidItem == false, "Item not for instant buy");
        _;
    }
    modifier IsForBidding(uint256 id){
        require(itemsForSale[id-1].bidItem == true, "Item not for bidding");
        _;
    }
    function addItemToMarket(uint256 tokenId, address tokenAddress, uint256 askingPrice, bool bidItem) OnlyItemOwner(tokenAddress, tokenId) HasTransferApproval(tokenAddress, tokenId) external returns(uint256) {
        require(activeItems[tokenAddress][tokenId] == false, "Item is already up for sale");

        if (auctionItemId[tokenId] == 0){ //item is being added for the first time in marketplace
            uint256 newItemId = itemsForSale.length + 1;
            itemsForSale.push(AuctionItem(newItemId, tokenAddress, tokenId, payable(msg.sender), askingPrice, false, bidItem, 0, address(0)));
            activeItems[tokenAddress][tokenId] = true;
            auctionItemId[tokenId] = newItemId;

            assert(itemsForSale[newItemId - 1].id == newItemId);
            emit ItemAdded(newItemId, tokenId, tokenAddress, askingPrice, bidItem);
            return newItemId;
        }
        else{ 
            itemsForSale[auctionItemId[tokenId] - 1].isSold = false;
            itemsForSale[auctionItemId[tokenId] - 1].bidItem = bidItem;
            itemsForSale[auctionItemId[tokenId] - 1].askingPrice = askingPrice;
        
            assert(itemsForSale[auctionItemId[tokenId] - 1].id == auctionItemId[tokenId]);
            emit ItemAdded(auctionItemId[tokenId], tokenId, tokenAddress, askingPrice, bidItem);
            return auctionItemId[tokenId];
        }
    }
    function BuyItem(uint256 id) external payable ItemExists(id) IsForSale(id) IsForInstantBuy(id) HasTransferApproval(itemsForSale[id-1].tokenAddress, itemsForSale[id-1].tokenId) {
        require(msg.value >= itemsForSale[id - 1].askingPrice, "Not enough funds set");
        require(msg.sender != itemsForSale[id - 1].seller);

        itemsForSale[id - 1].isSold = true;
        activeItems[itemsForSale[id - 1].tokenAddress][itemsForSale[id - 1].tokenId] = false;
        IERC721(itemsForSale[id - 1].tokenAddress).safeTransferFrom(itemsForSale[id - 1].seller, msg.sender, itemsForSale[id - 1].tokenId);
        itemsForSale[id - 1].seller.transfer(msg.value);

        itemsForSale[id - 1].seller = payable(msg.sender);
        emit ItemSold(id, msg.sender, itemsForSale[id - 1].askingPrice);
    }

    // put a bid on an item
    // modifiers: ItemExists, IsForSale, IsForBid, HasTransferApproval
    // args: auctionItemId
    // check if a bid already exists, if yes: check if this bid value is higher then prev

    function PlaceABid(uint256 aucItemId) external payable ItemExists(aucItemId) IsForSale(aucItemId) IsForBidding(aucItemId) HasTransferApproval(itemsForSale[aucItemId-1].tokenAddress, itemsForSale[aucItemId-1].tokenId) {
        uint256 totalPrice = 0;
        if (pendingReturns[msg.sender][itemsForSale[aucItemId-1].id] == 0){
            totalPrice = msg.value;
        }
        else{
            totalPrice = msg.value + pendingReturns[msg.sender][itemsForSale[aucItemId-1].id];
        }
        require(totalPrice > itemsForSale[aucItemId-1].askingPrice, "There is already a higher asking price");
        require(totalPrice > itemsForSale[aucItemId-1].bidPrice, "There is already a higher price");

        pendingReturns[msg.sender][itemsForSale[aucItemId-1].id] = 0;
        if (itemsForSale[aucItemId - 1].bidPrice != 0){
            pendingReturns[itemsForSale[aucItemId-1].bidderAddress][itemsForSale[aucItemId-1].id] = itemsForSale[aucItemId-1].bidPrice;
        }
        itemsForSale[aucItemId-1].bidPrice = totalPrice;
        itemsForSale[aucItemId-1].bidderAddress = msg.sender;
    
        //emit event new bid placed!
    }

    function withdrawPrevBid(uint256 aucItemId) external returns(bool) {
        uint256 amount = pendingReturns[msg.sender][aucItemId];
        if (amount > 0){
            pendingReturns[msg.sender][aucItemId] = 0;
            if (!payable(msg.sender).send(amount)) {
                // No need to call throw here, just reset the amount owing
                pendingReturns[msg.sender][aucItemId] = amount;
                return false;
            }
        }
        return true;
    }

    //end an auction
    // modifiers: ItemExists, IsForSale, IsForBid, HasTransferApproval
    // args: auctionItemId
    // check if a bid greater than askingPrice Exists, if yes: then,
    // send funds to msg.sender and
    // set ownership to bidderAddress
    // set activeItems of this item to false
    // set isSold to true
    // set pending transaction to zero

    function EndAuction(uint256 aucItemId) external payable ItemExists(aucItemId) OnlyItemOwnerAuc(aucItemId) IsForSale(aucItemId) IsForBidding(aucItemId) HasTransferApproval(itemsForSale[aucItemId-1].tokenAddress, itemsForSale[aucItemId-1].tokenId) returns(bool){
        require(itemsForSale[aucItemId - 1].bidPrice > itemsForSale[aucItemId - 1].askingPrice, "No Bids Exist!");
        // TASK: send itemsForSale[aucItemId - 1].bidPrice to itemsForSale[aucItemId - 1].seller;
        if (!itemsForSale[aucItemId - 1].seller.send(itemsForSale[aucItemId - 1].bidPrice)){
            return false;
        }
        else{
            IERC721(itemsForSale[aucItemId - 1].tokenAddress).safeTransferFrom(itemsForSale[aucItemId - 1].seller, itemsForSale[aucItemId - 1].bidderAddress, itemsForSale[aucItemId - 1].tokenId);
            activeItems[itemsForSale[aucItemId - 1].tokenAddress][itemsForSale[aucItemId - 1].tokenId] = false;
            itemsForSale[aucItemId - 1].isSold = true;
            pendingReturns[itemsForSale[aucItemId - 1].bidderAddress][itemsForSale[aucItemId - 1].tokenId] = 0;
            itemsForSale[aucItemId - 1].seller = payable(itemsForSale[aucItemId - 1].bidderAddress);
            itemsForSale[aucItemId - 1].bidderAddress = address(0);
            itemsForSale[aucItemId - 1].bidPrice = 0;
            itemsForSale[aucItemId - 1].bidItem = false;
            return true;
        }
    }
